"let root = document.querySelector('#root');
if (!root) {
	root = document.querySelector("body > div");
}

let previousHeights = [];
function setHeight(newHeight, force) {
  webkit.messageHandlers.onLog.postMessage(`maybe setheight ${newHeight}`);
  if (
	force ||
	(newHeight !== previousHeights[0] && newHeight !== previousHeights[1] && newHeight !== previousHeights[0] + "

")
  ) {
	 const args = JSON.stringify({ height: newHeight });
	 webkit.messageHandlers.onClientHeightChanged.postMessage(args);
	 previousHeights = [newHeight, previousHeights[0]];
	 return true;
  }
  return false;
}

// create an Observer instance
try {
  const resizeObserver = new ResizeObserver(function (entries) {
	 const height = entries[entries.length - 1].target.clientHeight;
	 setHeight(height);
  });
  if (root) {
	 // start observing a DOM node
	 resizeObserver.observe(root);
  }
} catch (e) {
  webkit.messageHandlers.onLog.postMessage(e.message);

  // Falling back to setInterval implementation
  setInterval(function findDialogBox() {
	 const newHeight = Math.max(root.scrollHeight, root.offsetHeight);
	 setHeight(newHeight);
  }, 100);
}

function refreshHeight() {
	return setHeight(root && root.clientHeight ? root.clientHeight : "", true);
}"

