"<script type="text/javascript">
window.q1Ready = function(q1) {
    q1.onCheckoutLoaded(function callback() {
        webkit.messageHandlers.onCheckoutLoaded.postMessage(null);
    });

    q1.onCustomerInfoChanged(function callback(customer) {
        const args = JSON.stringify({ customer });
        webkit.messageHandlers.onCustomerInfoChanged.postMessage(args);
    });

    q1.onCustomerDeauthenticating(function callback() {
        webkit.messageHandlers.onCustomerDeauthenticating.postMessage(null);
    });

    q1.onPaymentMethodChanged(function callback(paymentMethod) {
        const args = JSON.stringify({ paymentMethod });
        webkit.messageHandlers.onPaymentMethodChanged.postMessage(args);
    });

    q1.onPaymentDeclined(function callback(declineReason, declineReasonMessage) {
        const args = JSON.stringify({ declineReason, declineReasonMessage });
        webkit.messageHandlers.onPaymentDeclined.postMessage(args);
    });

    q1.onPaymentProcess(function start() {
        webkit.messageHandlers.onPaymentProcessStart.postMessage(null);
    }, function end() {
        webkit.messageHandlers.onPaymentProcessEnd.postMessage(null);
    });

    q1.onShippingMethodChanged(function callback(shipping) {
        const args = JSON.stringify({ shipping });
        webkit.messageHandlers.onShippingMethodChanged.postMessage(args);
    });

    q1.onShippingPriceChanged(function callback(newShippingPrice, newTotalShippingPrice) {
        const args = JSON.stringify({ newShippingPrice, newTotalShippingPrice });
        webkit.messageHandlers.onShippingPriceChanged.postMessage(args);
    });

    q1.onCompletePurchaseRedirect(function callback(redirect, data) {
        const args = JSON.stringify({ data });
        webkit.messageHandlers.onCompletePurchaseRedirect.postMessage(args);
    });

    q1.onTokenChanged("

", function callback(tokenData) {
        const args = JSON.stringify({ tokenData });
        webkit.messageHandlers.onTokenChanged.postMessage(args);
    });

    if (q1.onClosePopup) {
        q1.onClosePopup(function callback() {
            webkit.messageHandlers.onClosePopup.postMessage(null);
        })
    }
}
</script>
